import React from 'react';
import { View, Image } from 'react-native';
import StyleCentre from './StyleCenter';

const Center =()=>{
    return <View>
        <Image style = {StyleCentre.imgStyle} source ={require('data:image/jpeg;base64,')}></Image>
    </View>
}

export default Center;
